import * as React from 'react';
import { Text, View, Button, Image, StyleSheet} from 'react-native';
import {Card, Icon} from 'react-native-elements';
import FlipCard from 'react-native-flip-card'

export default function About({ route, navigation }) {

  return (
    <View style={{ flex: 1, alignItems: 'center', justifyContent: 'center', padding:'200'}}>
          <Image
            style= {{ width: 305, height: 400,justifyContent: 'center', borderColor : 'black', padding: 40, borderWidth : 2}}
            source=  {require('../assets/judith.jpeg')}
          />
        <Card>
            <Text style= {styles.font}> My name is Judith Sherbin and I am an Applied Math and Computer Science
            double major at Brandeis. </Text>
        </Card>
        <Icon raised name = "computer" type = "MaterialIcons" color = "purple"/>
        <Card>
            <Text style= {styles.font}>I was born in Hong Kong, but have spent most
            of my life in the San Francisco Bay Area. In my free time I love running,
            reading, traveling, and playing the ukulele.</Text>
        </Card>
        <Icon raised name = "plane" type = "fontisto" color = "purple"/>
        <Card>
            <Text style= {styles.font}> In my free time I love running,
            reading, traveling, and playing the ukulele.</Text>
        </Card>
    <Icon raised name = "music-note" type = "fontisto" color = "purple"/>


    </View>
  );
}


const styles = StyleSheet.create({
  icon:{
    justifyContent: "center",
    marginBottom: 12,
    paddingLeft: 10,
    paddingTop: 10,
  },

  font:{
    fontFamily: "Georgia",
    justifyContent: "center",
    fontSize: 30,
    fontWeight: 4,
  },

  card:{
    justifyContent: "center",
    height: 400,
    width: 300

  }

})
